int next_elev(int s, int t) {
    int mod = t % (2 * (m - 1)), full = t - mod;
    int board;
    if (mod <= s) {
        board = full + s;
    } else {
        if (mod <= 2 * (m - 1) - s) {
            board = full + 2 * (m - 1) - s;
        } else {
            board = full + 2 * (m - 1) + s;
        }
    }
    return board;
}
