def odd_even_sum(start, stop):
    if not isinstance(start, int) or not isinstance(stop, int):
        raise ValueError("Both start and stop must be integers.")

    if start > stop:
        start, stop = stop, start  # Ensure correct order

    odd_sum = sum(num for num in range(start, stop + 1) if num % 2 != 0)
    even_sum = sum(num for num in range(start, stop + 1) if num % 2 == 0)

    return [odd_sum, even_sum]

