bool prime(int n) {
    if (n == 0 || n == 1) return false;
    if (!(n & 1)) {
        if (n == 2)
            return true;
        else
            return false;
    }
    for (int i = 2; i * i <= n; i++)
        if (n % i == 0) return false;
    return true;
}
