class ArithmeticProgression():
  def __init__(self,a=1,d=1):
    self.a=a
    self.d=d
  def get(self,n):
    l=[]
    for i in range(n+1):
      c=self.a + (n+1)*self.d
      l.append(c)
    return l[n]
  def sum(n):
    p=0
    for i in range(n):
      c=self.a +(n+1)*self.d
      p+=c
    return p

