def sort_list(data_list):
    from collections import OrderedDict
    sort1 = sorted(data_list, key=lambda x: x[1], reverse=True)
    sort2 = [(x[1], x[0]) for x in sort1]
    sort3 = OrderedDict()
    for x in sort2:
        if x[0] in sort3:
            sort3[x[0]].append(x[1])
        else:
            sort3[x[0]] = [x[1]]
    for x in sort3:
        sort3[x].sort()
    sort4 = []
    for x in sort3:
        for y in sort3[x]:
            sort4.append((y, x))
    return sort4


